    template <int dim>
    class MyPrescribedBoundary : public BoundaryVelocity::Interface<dim>
    {
      public:
        /**
         * Constructor.
         */
	//        InclusionBoundary(): eta_B (1e3)
        //{}/


        /**
         * Return the boundary velocity as a function of position.
         */
        virtual
        Tensor<1,dim>
        boundary_velocity (const Point<dim> &position) const
	  {
	    double x = position[0];
	    double z = position[1];
	    
	          Tensor<1,dim> values;
values[0] = 0.3e1 / 0.4000000000000e13 * x * sin(0.3e1 / 0.400000e6 * z);
values[1] = cos(0.3e1 / 0.400000e6 * z) / 0.10000000e8 + sqrt(0.3141592654e1) * sqrt(0.2e1) * erf(sqrt(0.2e1) * (-z + 0.100000e6 * exp(-x / 0.100000e6) + 0.100000e6) / 0.20000e5) / 0.10000000000e11;

      return values;
	  }
    

        virtual void initialize ()
        { }

    };


  
